import React, { Component } from 'react';
import NavBar from '../components/NavBar/NavBar';

class Contact extends Component {
  render() {
    return (
      <div>
        <NavBar />
        <h1>Contact Page</h1>
      </div>
    )
  }
}

export default Contact;
